import Logo from '../../assets/Logo.png'
import './NavBar.css'

function NavBar() {
  return (
    <nav className="nav">
        <img src={Logo} alt="logo"></img>
        <ul>
            <li>
                <a href="/c">Cocktails</a>
            </li>
        </ul>
    </nav>
  )
}

export default NavBar;
